    <>
      <thead
        className={
          " h-full text-white rounded-[10px] p-[15px] shrink-1 sticky top-0 z-10" + tw_varTable_glassMorphBG
        }
      >
        <tr className=" [&>*]:p-[15px]">
          {/* <th>id</th> */}
          <th className="w-1/3">Variable Name</th>
          <th className="w-1/2">Type</th>
          <th className="w-1/2">Open Variable</th>
          {/* <th>Start Value</th>
          <>
