              <th>End Value</th>
            ) : null}
          </>
          <>
            {incomingTypeValidator.Integer ||
            incomingTypeValidator.List ||
            incomingTypeValidator.Date ? (
              <th>Iterate</th>
            ) : null}
          </>
          <>
            {(incomingTypeValidator.Integer ||
              incomingTypeValidator.List ||
              incomingTypeValidator.Date) &&
            incomingOtherTypeValidator.Iterate ? (
              <th>Inteval</th>
            ) : null}
          </>
          <>
            {incomingTypeValidator.Integer ||
            incomingTypeValidator.List ||
            incomingTypeValidator.Date ? (
              <th>Randomize</th>
            ) : null}
          </> */}
        </tr>
      </thead>
    </>
  );
}

export default VarTableHeader;
